import React from "react";
import ImageSlider from "../components/ImageSlider";
import "./Home.css"; // Estilos específicos de la página

const Home = () => {
  return (
    <div className="home-container">
      <ImageSlider />
      <div className="home-content">
        <h1>¡Disfruta una experiencia única!</h1>
        <p>
          Relájate en nuestra piscina al aire libre con instalaciones modernas y
          acogedoras.
        </p>
        <div className="home-buttons">
          <button className="btn btn-primary">Reservar Ahora</button>
          <button className="btn btn-secondary">Ver Tarifas</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
